import React, { useState, useEffect } from 'react';
import { Booking } from '../types';
import { bookingsApi } from '../services/api';
import { format } from 'date-fns';

const MyBookings: React.FC = () => {
  const [bookings, setBookings] = useState<Booking[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const fetchBookings = async () => {
      try {
        const response = await bookingsApi.getMyBookings();
        setBookings(response.data);
        setLoading(false);
      } catch (err) {
        setError('Failed to fetch bookings');
        setLoading(false);
      }
    };

    fetchBookings();
  }, []);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold mb-4">My Bookings</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {bookings.map((booking) => (
          <div key={booking.id} className="border p-4 rounded-lg">
            <p className="mb-2">Booking ID: {booking.id}</p>
            <p className="mb-2">Seat Place ID: {booking.seatPlaceId}</p>
            <p className="mb-2">
              Start Time: {format(new Date(booking.startTime), 'PPpp')}
            </p>
            <p className="mb-2">
              End Time: {format(new Date(booking.endTime), 'PPpp')}
            </p>
            <p className="mb-2">Status: {booking.status}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MyBookings;
